import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, useParams, useLocation } from 'react-router-dom';
import Register from './auth/Register';
import Login from './auth/Login';
import Adminlogin from './auth/Adminlogin';
import Adminregistration from './superadmin/Adminregistration.js';
import Superadmin from './auth/Superadmin';
import Dashboard from './User/Dashboard.js';
import Newgrievance from './User/Newgrievance.js';
import Adminmaster from './superadmin/Adminmaster.js';
import View from './View';
import Complaint from './superadmin/Complaint.js';
import Home from './User/Home.jsx';
import Dashboardsuperadmin from './superadmin/Dashboardsuperadmin.jsx';
import Manageusers from './superadmin/Manageusers.jsx';
import Footer from './Footer/Footer';
import Navbar from './Navbar/Navbar';
import Sidebar from './Sidebar/sidebar.jsx';
import SuperadminSidebar from './Sidebar/SuperadminSidebar.jsx';
import Adminsidebar from './Sidebar/adminsidebar.jsx';

function App() {
  const [image, setImage] = useState(null);
  const [userRole, setUserRole] = useState('');

  const handle = (name) => {
    setImage(name);
    console.log(name);
  };

  const params = useParams();
  const location = useLocation();

  useEffect(() => {
    console.log("Params ID:", params.id);
    if (['create-admin', 'superadmin', 'dashboards-a', 'manage-users'].includes(params.id)) {
      setUserRole('superadmin');
    } else {
      setUserRole('user');
    }
  }, [params]);

  const [showSidebar, setShowSidebar] = useState(false);

  const toggleSidebar = () => {
    setShowSidebar(!showSidebar);
  };

  // Determine which sidebar to show based on the current route
  const renderSidebar = () => {
    if (location.pathname.startsWith('/superadmin')) {
      return <SuperadminSidebar showSidebar={showSidebar} toggleSidebar={toggleSidebar} />;
    } else if (location.pathname.startsWith('/admin')) {
      return <Adminsidebar showSidebar={showSidebar} toggleSidebar={toggleSidebar} />;
    } else {
      return <Sidebar showSidebar={showSidebar} toggleSidebar={toggleSidebar} />;
    }
  };

  return (
    <>
      <div className="area">
        <ul className="circles">
          <li></li>
          <li></li>
          <li></li>
          <li></li>
          <li></li>
          <li></li>
          <li></li>
          <li></li>
          <li></li>
          <li></li>
        </ul>

        <div className="context">
          <Router>
            <Navbar toggleSidebar={toggleSidebar} />
            {renderSidebar()}
            <Routes>
              <Route path='/' element={<Home />} />
              <Route path='/user/history' element={<Dashboard />} />
              <Route path='/user/new' element={<Newgrievance />} />
              <Route path='/superadmin/complaint/1' element={<Complaint handle_view={handle} />} />
              <Route path='/admin/complaint' element={<Complaint handle_view={handle} />} />
              <Route path='/superadmin/create-admin/1' element={<Adminregistration />} />
              <Route path='/superadmin/1' element={<Adminmaster handle_view={handle} />} />
              <Route path='/superadmin/dashboards-a/1' element={<Dashboardsuperadmin />} />
              <Route path='/superadmin/manage-users/1' element={<Manageusers />} />
              <Route path='/superadminlogin' element={<Superadmin />} />
              <Route path='/adminlogin' element={<Adminlogin />} />
              <Route path="/register" element={<Register />} />
              <Route path="/login" element={<Login />} />
              <Route path="/image" element={<View image={image} />} />
            </Routes>
            <Footer />
          </Router>
        </div>
      </div>
    </>
  );
}

export default App;
